import React, { Component } from 'react'

class app extends Component {
    render() {
        return (
            <Container class="home">
                <head charset="utf-8">
                    <title>Stickers</title>
                </head>
                <body class="container">
                    <header class="page-header">
                                <h1>Pi carre Login</h1>
                                <a>Home</a>
                    </header>
                </body>
            </Container>
        )
    }
}
export default app;
